    #[test]
    fn arithmetictest(){
        for i in 0..SUM_VALUES.len(){
            let res_sum = Fp::new(U256::from_be_hex(SUM_VALUES[i]));
            let res_mul = Fp::new(U256::from_be_hex(MUL_VALUES[i]));
            let x1 = Fp::new(U256::from_be_hex(VALUES_A[i]));
            let x2 = Fp::new(U256::from_be_hex(VALUES_B[i]));
            //add test
            assert_eq!(x1 + x2 , res_sum);
            assert_eq!(x1 + x1, x1.double());
            //sub
            assert_eq!(x1 - x2, x1.sub(x2));
            assert_eq!(x1 + Fp::neg(x2), x1.sub(x2));
            //mul
            assert_eq!(x1 * x2, res_mul);
            //invert
            assert_eq!(x1 * x2.invert().unwrap(), x1/ x2);
            //square
            assert_eq!(x1 * x1, x1.square());
            //triple
            assert_eq!(x1 + x1 + x1, x1.triple());
            //cube 
            assert_eq!(x1.square() * x1, x1.cube());
            //powerby
            assert_eq!(x1.power_by((Fp::ONE).to_words()), x1);
            assert_eq!(x1.power_by(((Fp::ONE).double()).to_words()), x1*x1);
            //sqrt
            assert_eq!(x1.square().sqrt().unwrap() * x1.square().sqrt().unwrap(), x1*x1)
        }
    }

