    #[test]
    fn addcheck(){
        for i in 1..50{
            let mut a = FP2ARR1[i];
            let b = FP2ARR2[i];
            let asumb = FP2SUM[i];
            assert_eq!(a+b, asumb);
            a+=b;
            assert_eq!(a, asumb);
            assert_eq!(a+a, a.double());
            assert_eq!(a+a+a, a.triple());
        }
    }

    #[test]
    fn mulcheck(){
        for i in 0..50{
            let mut a = FP2ARR1[i];
            let b = FP2ARR2[i];
            let amulb = FP2MUL[i];
            assert_eq!(a*b, amulb);
            a*=b;
            assert_eq!(a, amulb)
        }
    }
    #[test]
    fn subcheck(){
        for i in 1..2{
            let mut a = FP2SUM[i];
            let b = FP2ARR2[i];
            let c = FP2ARR1[i];
            assert_eq!(a-b , c);
            a-=b;
            assert_eq!(a, c)
        }
    }
    #[test]
    fn divcheck(){
        for i in 0..50{
            let mut a = FP2MUL[i];
            let b = FP2ARR1[i];
            let adivb = FP2ARR2[i];
            assert_eq!(a/b, adivb);
            a/=b;
            assert_eq!(a,adivb)
        }
    }
